 , Dixdc 1 ,

 , Q9NXR1 , Q9GZM8 ) , neural progenitor proliferation ( GSK 3 ) , neurosignalling ( Q3V6T2 , GSK 3 , DB05876 ) and synaptic function ( Kal 7 , Q9UKE5 ) . Furthermore , emerging evidence of genetic association ( Q9GZM8 , PCM 1 ,

<div class="entities" style="line-height: 2.5; direction: ltr">Biochemical properties of V91G calmodulin : A calmodulin point mutation that deregulates muscle contraction in Drosophila . A mutation ( Cam 7 ) to the single endogenous calmodulin gene of Drosophila generates a mutant protein with valine 91 changed to glycine ( V91G D - P62158 ) . This mutation produces a unique pupal lethal phenotype distinct from that of a null mutation . Genetic studies indicate that the phenotype reflects deregulation of calcium fluxes within the larval muscles , leading to hypercontraction followed by muscle failure . We investigated the biochemical properties of V91G D - P62158 . The effects of the mutation on free P62158 are minor : 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB01373
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 binding , and overall secondary and tertiary structure are indistinguishable from those of wild type . A slight destabilization of the C-terminal domain is detectable in the calcium-free ( apo - ) form , and the calcium-bound ( holo - ) form has a somewhat lower surface hydrophobicity . These findings reinforce the indications from the in vivo work that interaction with a specific P62158 target ( s ) underlies the mutant defects . In particular , defective regulation of ryanodine receptor ( RyR ) channels was indicated by genetic interaction analysis . Studies described here establish that the putative P62158 binding region of the Drosophila RyR ( D-RyR ) binds wild-type D - P62158 comparably to the equivalent P62158 - RyR interactions seen for the mammalian skeletal muscle RyR channel isoform ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P21817
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) . The V91G mutation weakens the interaction of both apo - and holo-D - P62158 with this binding region , and decreases the enhancement of the calcium-binding affinity of P62158 that is detectable in the presence of the RyR target peptide . The predicted functional consequences of these changes are consonant with the in vivo phenotype , and indicate that D-RyR is one , if not the major , target affected by the V91G mutation in P62158 .</div>

 ) was identified . This stop-gained mutation segregated with hearing impairment within the family and was not identified in ethnically matched controls or within variant databases . This mutation is predicted to cause the loss of 82 amino acids from the carboxyl tail , including highly conserved residues within the catalytic domain , plus a calmodulin-stimulation defect , both of which are expected to decrease enzymatic efficiency . Individuals who are homozygous for this mutation had symmetric , mild-to-moderate mixed hearing impairment . Zebrafish adcy 1b morphants had no FM1 - 43 dye uptake and lacked startle response , indicating hair cell dysfunction and gross hearing impairment . In the mouse , Adcy 1 expression was observed throughout inner ear development and maturation .
